import styled from 'styled-components';
export const Div0 = styled.div`
    width: 100%;
    height: 100%;

    border: 2px solid #8E8E8E;
    border-radius:10px

`
export const Div1 = styled.div`
    width: 100%;
    height: 10%;
    border-bottom: 2px solid #8E8E8E;
    text-align: center;
    padding-top: 5%;
    font-size: 30px;


`
